import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import { NavLink } from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.min.css';
// import { useContext } from 'react';
// import { CartContext } from '../context/CartContext';

function Navb() {
    // const { cartItems } = useContext(CartContext);
  return (
    
    <>
     <Navbar bg="light" expand="lg" className="py-2 border-bottom">
          <Container>
            <Navbar.Brand as={Link} to="/">Yegna Trading</Navbar.Brand>
            <Navbar.Toggle aria-controls="basic-navbar-nav" />
            <Navbar.Collapse id="basic-navbar-nav" className="justify-content-center">
              <Nav className="mx-auto">
                <Nav.Link as={Link} to="/">Home</Nav.Link>
                <Nav.Link as={Link} to="/add-sales">Add Sales</Nav.Link>
                <Nav.Link as={Link} to="/sales">Sales</Nav.Link>
                <Nav.Link as={Link} to="/total-sales">Total Sales</Nav.Link>
                <Nav.Link as={Link} to="/detail">Detail</Nav.Link>
                <Nav.Link as={Link} to="/add-purchase">Add Purchase</Nav.Link>
                <Nav.Link as={Link} to="/purchase">Purchase</Nav.Link>
                <Nav.Link as={Link} to="/remaining">Remaining</Nav.Link>
                <Nav.Link as={Link} to="/store">Store (Balance)</Nav.Link>
              </Nav>
            </Navbar.Collapse>
          </Container>
        </Navbar>
    </>
  );
}

export default Navb;
